import React from "react";
import Card from "./Card" 
import Sdata from "./Sdata"

const Courses = () => {
  return (
    <>
      <h1 className="heading_style"> Most used Coursess </h1>
      {Sdata.map((val) => {
         return (
            <Card 
              key={val.id}
              imgsrc={val.imgsrc}
              title={val.title}
              sname= {val.sname}
              link={val.link} 
              subtitle={val.subtitle}
            /> 
         )   
       })}
    </>
  );
};

export default Courses;
